<?php

namespace App\Http\Controllers;

use Illuminate\Foundation\Bus\DispatchesJobs;
use Illuminate\Routing\Controller as BaseController;
use Illuminate\Foundation\Validation\ValidatesRequests;
use Illuminate\Foundation\Auth\Access\AuthorizesRequests;
use Illuminate\Http\Request;

class Controller extends BaseController
{
    use AuthorizesRequests, DispatchesJobs, ValidatesRequests;

    /**
     * The function magages the upload of imgs to the database
     * @param $case4Handler
     * @param Request $request
     * @param $controllername
     * @return bool|string
     */
    public function handleProductImageUpload($case4Handler, Request $request, $controllername) {

        $file_name = $_FILES['image']['name'];
        $file_size = $_FILES['image']['size'];
        $file_tmp = $_FILES['image']['tmp_name'];
        $file_type = $_FILES['image']['type'];
        $file_error = $_FILES['image']['error'];

        //allowed image types
        $expensions = array("image/jpeg", "image/jpg", "image/png", "image/bmp");

        //image error handler
        //explained
        // http://php.net/manual/en/features.file-upload.errors.php
        if ($file_error != 0) {
            switch ($file_error) {
                case 1:
                    $request->session()->flash('error', 'File cannot exceed 2 mbs.');
                    return false;
                    break;
                case 2:
                    $request->session()->flash('error', 'File cannot exceed 2 mbs.');
                    return false;
                    break;
                case 3:
                    $request->session()->flash('error', 'The uploaded file was only partially uploaded.');
                    return false;
                    break;
                case 4:
                    // if there is no uploaded file, add placeholder blob image.
                                if($controllername == 'achievements'){
                                    $placeholderBlob = "";
                                }else if ($controllername == 'suggestions'){
                                    $placeholderBlob = "";

                                }else if ($controllername == 'boardgames'){
                                    $placeholderBlob = "";

                                }else if($controllername == 'users'){
                                    $placeholderBlob = "";
                                }
                    //returns placeholderblob or an empty string
                    if($case4Handler == 'post'){
                        return $placeholderBlob;
                    }else if ($case4Handler == 'update'){
                        return 'noimage';
                    }
            }
            //checks file expension
        }else if (in_array($file_type, $expensions) === false){

            $request->session()->flash('error', 'Extension not allowed, please choose a JPEG or PNG file.');
            return false;

        }else
            // Greturns base64 encoded image
            return base64_encode(file_get_contents($_FILES['image']['tmp_name']));
    }
}
